import { Helmet } from 'react-helmet';
import ExListContainer from '../uk/container/ExListContainer';
import { Box, Container, Grid } from '@material-ui/core';

const UK = () => (
  <>
    <Helmet>
      <title>KDB Studio</title>
    </Helmet>
    <Box
      sx={{
        display: 'flex',
        flex: '1 1 auto',
        backgroundColor: 'background.default',
        minHeight: '100%', // 필수
        height: '100%',
        paddingLeft: 5,
        py: 1,
      }}
    >
      <Box
        sx={{
          height: '100%',
          minHeight: '100%',
          boxShadow: 3,
          width: 220,
        }}
      >
        <Box sx={{ boxShadow: 1 }}>
          <IconButton arial-labe="Add root UK" onClick={this.funcAddRootUk}>
            <AddIcon />
          </IconButton>
        </Box>
        <ExListContainer />
      </Box>
      <Box></Box>
    </Box>
  </>
);

export default UK;
